import './style.css';
import { useState } from 'react';
import Button from '../Button';
import HiddenInput from '../HiddenInput';

const ScrappedData = () => {
  const initialValues = {
    name: '',
    shop: '',
    price: '',
    currency: '',
    expectedPrice: '',
    tracked: '',
  };

  const [state, setState] = useState(initialValues);

  const onChange = (e) =>
    setState({ ...state, [e.target.name]: e.target.value });

  return (
    <div className="scrapped-data-wrapper">
      <div className="item-data">
        <div className="sd-item sd-name">
          <div className="sd-label">Name</div>
          <div className="sd-value">
            <HiddenInput
              type="text"
              inputName="name"
              value={state.name}
              onChange={onChange}
              required={true}
              disabled={true}
            />
          </div>
        </div>
        <div className="sd-item sd-shop">
          <div className="sd-label">Shop</div>
          <div className="sd-value">
            <HiddenInput
              type="text"
              inputName="name"
              value={state.shop}
              onChange={onChange}
              required={true}
              disabled={true}
            />
          </div>
        </div>
        <div className="sd-item sd-price">
          <div className="sd-label">Price</div>
          <div className="sd-value">
            <HiddenInput
              type="text"
              inputName="name"
              value={state.name}
              onChange={onChange}
              required={true}
              disabled={true}
            />
            <HiddenInput
              type="text"
              inputName="name"
              value={state.name}
              onChange={onChange}
              required={true}
              disabled={true}
            />
          </div>
        </div>
      </div>
      <div className="sd-options">
        <Button value="Add to list" />
        <Button value="Edit" />
      </div>
    </div>
  );
};

export default ScrappedData;
